import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for page to fully load and ensure profile links are available
    await page.waitForSelector('a', { timeout: 10000 });

    // Find and click on Jun's Profile link
    // Using multiple selector strategies to ensure we find the correct profile link
    const profileLinks = await page.$$eval('a', anchors => 
      anchors.filter(a => a.textContent.includes('Your Profile')).map(a => ({
        text: a.textContent.trim(),
        href: a.href
      }))
    );

    // Click on the first "Your Profile" link found
    await page.click('text="Your Profile"', { timeout: 5000 });

    // Wait for profile page to load
    await page.waitForSelector('.profile-page', { timeout: 10000 });
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot after navigating to profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information to verify successful navigation
    const profileInfo = await page.evaluate(() => {
      const nameElement = document.querySelector('.profile-info h2');
      const usernameElement = document.querySelector('.username');
      const bioElement = document.querySelector('.bio');

      return {
        name: nameElement ? nameElement.textContent.trim() : null,
        username: usernameElement ? usernameElement.textContent.trim() : null,
        bio: bioElement ? bioElement.textContent.trim() : null
      };
    });

    return {
      success: true,
      action: "Navigated to Jun's Profile page successfully",
      extractedData: profileInfo,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
